import React from "react";

export function MainSection({userData})  {
  return(
    <div className="main-section">
      {userData.map((user) => {
        return (
          <div>
            <span>Driver : </span>{user.name}
            <div>{user.role}</div>
          </div>
        )
        }
      )}
    </div>
  )
}
